  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link I along its track during twenty-five dives of the 2004 \"Life on
  the Edge\" expedition sponsored by the National Oceanic and Atmospheric Administration
  (NOAA) Office of Ocean Exploration, June 8 through 22, 2004. Measurements and information
  include sub's position, altitude, and depth; personnel assignments; dive, mission,
  and vehicle ID's; and sound velocity measurements. The Marine Operations Division
  of the Harbor Branch Oceanographic Institution provided the original submersible
  data.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
